				"  _ANALYTICS_IDFV_COLLECTION=$(getFirebaseJsonKeyValue \"$_JSON_OUTPUT_RAW\" \"analytics_idfv_collection_enabled\")",
				"  if [[ $_ANALYTICS_IDFV_COLLECTION ]]; then",
