				"    _PLIST_ENTRY_TYPES+=(\"bool\")",
				"    _PLIST_ENTRY_VALUES+=(\"$(jsonBoolToYesNo \"$_ANALYTICS_IDFV_COLLECTION\")\")",
				"  fi",
				"",
				"  # config.analytics_default_allow_analytics_storage",
